import { jsPDF } from 'jspdf';

// ✅ Logo base64 (puedes reemplazar este por el tuyo)
const logoBase64 = 'data:image/png;base64,';

const generateReportPDF = (report) => {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const margin = 20;
    let y = margin;

    // 🖼️ Logo y título
    doc.addImage(logoBase64, 'PNG', margin, y, 20, 20);
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(16);
    doc.text('SOLUCIONES INFORMÁTICAS', pageWidth / 2, y + 12, { align: 'center' });

    y += 28;
    doc.setLineWidth(0.5);
    doc.line(margin, y, pageWidth - margin, y);
    y += 8;

    // 🔎 Datos en columnas
    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');

    const leftX = margin;
    const rightX = pageWidth / 2;

    const printRow = (label1, value1, label2, value2) => {
        doc.setFont('helvetica', 'bold');
        doc.text(`${label1}:`, leftX, y);
        doc.setFont('helvetica', 'normal');
        doc.text(`${value1}`, leftX + 40, y);

        doc.setFont('helvetica', 'bold');
        doc.text(`${label2}:`, rightX, y);
        doc.setFont('helvetica', 'normal');
        doc.text(`${value2}`, rightX + 40, y);
        y += 8;
    };

    printRow('Cliente', report.clientName || 'N/A', 'DNI', report.clientDNI || 'N/A');
    printRow('Dirección', report.clientAddress || 'N/A', 'Teléfono', report.clientPhone || 'N/A');
    printRow('Fecha', new Date(report.createdAt).toLocaleDateString(), 'Tipo de Mantenimiento', report.maintenanceType || 'N/A');

    y += 6;
    doc.setFont('helvetica', 'bold');
    doc.text('EQUIPO REPORTADO', margin, y);
    y += 8;

    printRow('Tipo', report.equipment?.type || 'N/A', 'Marca', report.equipment?.brand || 'N/A');
    printRow('Modelo', report.equipment?.model || 'N/A', 'Serie', report.equipment?.serial || 'N/A');

    const writeSection = (title, content) => {
        y += 8;
        doc.setFont('helvetica', 'bold');
        doc.text(`${title}:`, margin, y);
        y += 6;
        doc.setFont('helvetica', 'normal');
        const lines = doc.splitTextToSize(content || 'N/A', pageWidth - margin * 2);
        doc.text(lines, margin, y);
        y += lines.length * 6;
    };

    writeSection('Descripción de la Falla', report.faultDescription);
    writeSection('Observaciones / Acciones Realizadas', report.observations);

    printRow('Estado final', report.status || 'N/A', 'Precio pactado', `S/. ${report.agreedPrice || '0.00'}`);

    writeSection('Comentarios', report.comments);

    // ✍️ Firmas
    y += 12;
    doc.setFont('helvetica', 'bold');
    doc.text('Firma de Recepción:', margin, y);
    doc.text('Firma del Técnico:', rightX, y);
    y += 14;
    doc.setLineWidth(0.4);
    doc.line(margin, y, margin + 60, y);
    doc.line(rightX, y, rightX + 60, y);

    // 📌 Footer
    y = doc.internal.pageSize.getHeight() - 20;
    doc.setFontSize(10);
    doc.setFont('helvetica', 'normal');
    doc.setTextColor(100);
    doc.text(
        'Condición: Se recarga el 20% del total si no se recoge el equipo en 30 días. No nos responsabilizamos por equipos no reclamados.',
        margin,
        y,
        { maxWidth: pageWidth - margin * 2 }
    );

    // 💾 Exportar
    doc.save(`reporte_${report.clientName || 'cliente'}.pdf`);
};

export default generateReportPDF;